import React, { useState } from "react";
import Display from "./Display";
import Calculate from "./Calculate";
export default function Interface() {
  let [displayString, setdisplayString] = useState({});
  return (
    <div>
      <div>
        <button
          onClick={() => {
            setdisplayString(1);
          }}
        >
          1
        </button>
        <button>2</button>
        <button>3</button>
        <button>+</button>
        <br></br>
        <button>4</button>
        <button>5</button>
        <button>6</button>
        <button>-</button>
        <br></br>
        <button>7</button>
        <button>8</button>
        <button>9</button>
        <button>/</button>
        <br></br>
        <button>0</button>
        <button onClick={<Display value={" "} />}>AC</button>
        <button onClick={<Calculate value={displayString} />}>=</button>
        <button>x</button>
      </div>
      <div>
        <Display value={displayString} />
      </div>
    </div>
  );
}
